import React, { useState } from 'react';
import Banner from './Banner';
import Categories from './Categories';

function App() {
  const [rankings, setRankings] = useState({
    "Programming in C++": 0,
    "ADTs": 0,
    "Recursion": 0,
    "Backtracking": 0,
    "Classes": 0,
    "Linked Lists": 0,
    "Trees": 0
  });

  const handleRankChange = (topic, rank) => {
    setRankings(prev => ({ ...prev, [topic]: rank }));
  };

  const handleSubmit = () => {
    // Here you would handle the submission of the rankings
    console.log(rankings);
    alert('Rankings submitted!');
  };

  return (
    <div className="App">
      <Banner />
      <Categories topics={rankings} onRankChange={handleRankChange} onSubmit={handleSubmit} />
    </div>
  );
}

export default App;
